const App = () => {
    const [num , setnum] = useState(null);

    const Api = async() => {
        const url = "https://api.tvmaze.com/search/shows?q=all";
        const res = await fetch(url);
        const ress = await res.json();
        console.log(ress[0].show.name);
        setnum(ress);
    }   

        
    Api();
   

  
    return (
        <>
        <p>
            {num.name}
        </p>
        

  

        </>

    )
};

export default App;
